            <div>
        <h1>{counter}</h1>
        <h2>text:{JSON.stringify(state, null, 2)}</h2>
                <button onClick={increment}>add</button>
                <button onClick={decrement}>remove</button>
                <button onClick={change}>change</button>
            </div>
        )


}

